.navbar-basic {
  top: 0;
  position: fixed;
  height: 80px;
  width: 100%;
  background-color: white;
  border-bottom: 1px solid #dde1e6;
  .nav {
    display: flex;
    justify-content: space-between;
    align-items: center;
    width: 100%;
    padding: 0rem 6rem;
    .navLink {
      position: relative;
      display: flex;
      flex-direction: row;
      cursor: pointer;
      .link {
        margin: 0rem 24px;
        display: flex;
        align-items: center;
      }
      button {
        padding: 16px 12px;
        background-color: #6192d3;
        color: white;
        border-radius: 6px;
        width: 122px;
        display: inline-flex;
        justify-content: center;
        align-items: center;
      }
      .link-dropdown {
        top: 80px;
        position: absolute;
        z-index: 100010 !important;
        box-shadow: 2px 3px 20px 0px #00000014;
        background-color: white;
        min-height: 200px;
        width: 260px;
        padding: 16px 20px;
        border-radius: 6px;
        .link-dropdown-item {
          display: flex;
          padding: 8px;
          &:hover {
            color: #6192d3;
            font-weight: bold;
          }
          img {
            margin-right: 4px;
          }
        }
      }
    }
  }
  .title {
    color: black;
    display: flex;
    align-items: center;
    font-size: 20px;
  }
}

.navMenu {
  position: relative;
  display: none;
  .phoneMenu {
    position: absolute;
    box-shadow: rgba(100, 100, 111, 0.2) 0px 7px 29px 0px;
    background-color: white;
    top: 80px;
    right: 0;
    width: 260px;
    min-height: 200px;
    padding: 8px 16px;
    border-radius: 6px;
    .link {
      padding: 8px;
      cursor: pointer;
      &:hover {
        color: #6192d3;
        font-weight: bold;
      }
    }
  }
}

.fullScreen {
  width: 100vw;
  height: 100vh;
  position: fixed;
  z-index: 5000;
  background-color: rgba(0, 0, 0, 0.5);
}
.active {
  color: #6192d3;
  font-weight: bold;
}

@media screen and (max-width: 991px) {
  .navbar-basic {
    .nav {
      padding: 0rem 2rem;
    }
  }

  .navMenu {
    display: block;
  }
  .navLink {
    display: none !important;
  }
}
.dialogContact {
  padding: 1rem;
}

